import './css/Login.css';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from '../Pages/Login_Page.js';


function App() {
  return (
      <Router>
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
      </Router>
  );
}

export default App;
